import React from "react"
import * as ReactDOMClient from "react-dom/client"


function Header() {
    return <header>Header of website</header>
}

function App() {

    return (<div>
        <Header/> 
    <input placeholder="Enter"/>
   </div>)
}

const app = ReactDOMClient.createRoot(document.getElementById("root"))



app.render(<App/>)
